import React from "react";
import Joke from "./joke";
export default App => {
  return (
    <div>
      <Joke class={{ question: "what the fuck?", punchline: "i am yours" }} />
      <Joke
        class={{ question: "what is your name?", punchline: "you are mine!!" }}
      />
    </div>
  );
};
